import "./TopMenu.css";

function TopMenu() {
  return (
    <div className="TopMenu">
      <form>
        아이디 <input type="text" name="loginId" className="loginInput" /> |
        비밀번호 <input type="text" name="loginPw" className="loginInput" />
        <button type="submit">로그인</button>
      </form>
    </div>
  );
}

export default TopMenu;
